import React from "react";
import "./MainPage.css";
import { Box, Typography } from "@mui/material";

const MainPage = () => {

  return (
    <Box className="mainPage">
      <Box sx={{display:"flex",flexDirection:"column"}}>
        <Typography variant="h5" sx={{ fontWeight: "bold" }}>
          상품 리스트
        </Typography>
        <Box sx={{display:"flex",flexDirection:"column"}}>

        </Box>
      </Box>
      <Box sx={{display:"flex",flexDirection:"column"}}>
        <Typography variant="h5" sx={{ fontWeight: "bold" }}>
          북마크 리스트
        </Typography>
      </Box>
    </Box>
  );
};

export default MainPage;
